import React from "react";
import { Container, Card, Row, Col, Button } from "react-bootstrap";
import bracelet from "./IMG1/bracelet.jpg";
import drone from "./IMG1/drone.jpg";
import flower from "./IMG1/flower.jpg";
import laptop from "./IMG1/laptop.jpg";
import mouse from "./IMG1/mouse.jpg";
import ring from "./IMG1/ring.jpg";
import seat from "./IMG1/seat.jpg";
import hoodie from "./IMG1/hoodie.jpg";

function Products2() {
  const products = [
    {
      title: "Bracelet",
      cost: "$6.99",
      image: bracelet,
    },
    {
      title: "Drone",
      cost: "$6.99",
      image: drone,
    },
    {
      title: "Flower",
      cost: "$6.99",
      image: flower,
    },
    {
      title: "Laptop",
      cost: "$6.99",
      image: laptop,
    },
    {
      title: "Mouse",
      cost: "$6.99",
      image: mouse,
    },
    {
      title: "Ring",
      cost: "$6.99",
      image: ring,
    },
    {
      title: "Seat",
      cost: "$6.99",
      image: seat,
    },
    {
      title: "Hoodie",
      cost: "$6.99",
      image: hoodie,
    },
  ];

  return (
    <div className="bg-dark py-3">
      <Container>
        <h2 className="text-light">MORE TO LOVE</h2>
        <Row className="g-2">
          {products.map((product) => {
            return (
              <Col xs={6} md={4} xl={3}>
                <Card>
                  <Card.Img
                    style={{ height: "220px" }}
                    src={product.image}
                    alt
                    rounded
                  />
                  <Card.Text>{product.cost}</Card.Text>
                  <Card.Title>{product.title}</Card.Title>
                  <Button>Add To Cart</Button>
                </Card>
              </Col>
            );
          })}
        </Row>
      </Container>
    </div>
  );
}

export default Products2;
